import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <>
      <nav>
        <div className="">
          <div className="logo">Logo</div>
          <ul>
            <li>
              <Link to="/login">1</Link>
            </li>
            <li>
              {" "}
              <Link to="/register">3</Link>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
